export default function TaskList({list}) {
    // const categories = ['To DO', 'In Progress', 'Done'];
  return (
    <div>
     {list.map((task, index) => (
       <div key={index}>
         <h3>{task.name}</h3>
         <p>Category: {task.category}</p>
       </div>
     ))}    
    </div>
  );
}
